import React from "react";

class TextInput extends React.Component {
  render() {
    return (
      <div class="ui form">
        <div class="field">
          <label>Escreva sua mensagem</label>
          <input type="text" />
        </div>
      </div>
    );
  }
}

export default TextInput;
